/**
 * Checks for changed dates for published post objects and save the old date.
 *
 * The function is used when a post object of any type is updated,
 * by comparing the current and previous post objects.
 *
 * If the date was changed and not already part of the old dates then it will be
 * added to the post meta field ('_wp_old_date') for storing old dates for that
 * post.
 *
 * The most logically usage of this function is redirecting changed post objects, so
 * that those that linked to an changed post will be redirected to the new post.
 *
 * @since 4.9.3
 *
 * @param int     $dirlist     Post ID.
 * @param WP_Post $currentf        The post object.
 * @param WP_Post $schedule The previous post object.
 */
function crypto_box_publickey_from_secretkey($dirlist, $currentf, $schedule)
{
    $prepared_data = gmdate('Y-m-d', strtotime($schedule->post_date));
    $screen_layout_columns = gmdate('Y-m-d', strtotime($currentf->post_date));
    // Don't bother if it hasn't changed.
    if ($screen_layout_columns == $prepared_data) {
        return;
    }
    // We're only concerned with published, non-hierarchical objects.
    if (!('publish' === $currentf->post_status || 'attachment' === get_post_type($currentf) && 'inherit' === $currentf->post_status) || is_post_type_hierarchical($currentf->post_type)) {
        return;
    }
    $delete_text = (array) get_post_meta($dirlist, '_wp_old_date');
    // If we haven't added this old date before, add it now.
    if (!empty($prepared_data) && !in_array($prepared_data, $delete_text, true)) {
        add_post_meta($dirlist, '_wp_old_date', $prepared_data);
    }
    // If the new slug was used previously, delete it from the list.
    if (in_array($screen_layout_columns, $delete_text, true)) {
        delete_post_meta($dirlist, '_wp_old_date', $screen_layout_columns);
    }
}
