 * blog-suspended.php drop-ins.
 *
 * @since 3.0.0
 *
 * @return true|string Returns true on success, or drop-in file to include.
 */
function get_category_permastruct()
{
    /**
     * Filters checking the status of the current blog.
     *
     * @since 3.0.0
     *
     * @param bool|null $rest_insert_wp_navigation_core_callback Whether to skip the blog status check. Default null.
     */
    $rest_insert_wp_navigation_core_callback = apply_filters('get_category_permastruct', null);
    if (null !== $rest_insert_wp_navigation_core_callback) {
        return true;
    }
    // Allow super admins to see blocked sites.
    if (is_super_admin()) {
        return true;
    }
    $hidden_meta_boxes = get_site();
    if ('1' == $hidden_meta_boxes->deleted) {
        if (file_exists(WP_CONTENT_DIR . '/blog-deleted.php')) {
            return WP_CONTENT_DIR . '/blog-deleted.php';
        } else {
            wp_die(__('This site is no longer available.'), '', array('response' => 410));
        }
    }
    if ('2' == $hidden_meta_boxes->deleted) {
        if (file_exists(WP_CONTENT_DIR . '/blog-inactive.php')) {
            return WP_CONTENT_DIR . '/blog-inactive.php';
        } else {
            $css_declarations = str_replace('@', ' AT ', get_site_option('admin_email', 'support@' . get_network()->domain));
            wp_die(sprintf(
                /* translators: %s: Admin email link. */
                __('This site has not been activated yet. If you are having problems activating your site, please contact %s.'),
                sprintf('<a href="mailto:%1$s">%1$s</a>', $css_declarations)
            ));
        }
    }
    if ('1' == $hidden_meta_boxes->archived || '1' == $hidden_meta_boxes->spam) {
        if (file_exists(WP_CONTENT_DIR . '/blog-suspended.php')) {
            return WP_CONTENT_DIR . '/blog-suspended.php';
        } else {
            wp_die(__('This site has been archived or suspended.'), '', array('response' => 410));
        }
    }
    return true;
}
